import './App.css';
import Navbar from './Components/Navbar';
import ProfilePic from './Assets/profile_crop.png';

function App() {
  return (
    <div className="App">
      <Navbar />
      <p style={{ display: 'flex', justifyContent: 'center' }}>Hi I'm Josh.</p>
      <div className="profile">
        <img src={`${ProfilePic}`} width="500px" />
      </div>
    </div>
  );
}

export default App;
